gunichar *unshape_arabic(gunichar *src, unsigned len, unsigned *_len) {
  // First we calculate the length of the string we are gooing to allocate.
  unsigned length = 0;
  gunichar ch;
  unsigned x;
  for (x = 0; x < len; x++) {
    ch = src[x];
    if ((ch < LOWEST_SHAPE) || (ch > HIGHEST_SHAPE)) {
      length++;
      continue;
    }
    ch -= LOWEST_SHAPE;
    if (unshaping_table[ch].junk) {
      length++;
      continue;
    }
    else {
      length += unshaping_table[ch].len;
    }
  }

  *_len = length;
  // Now we have the length.
  gunichar *out = g_malloc(sizeof(gunichar) * (length+1));

  unsigned y = 0;
  for (x = 0; x < len; x++) {
    ch = src[x];
    if ((ch < LOWEST_SHAPE) || (ch > HIGHEST_SHAPE)) {
      out[y++] = ch;
      continue;
    }
    ch -= LOWEST_SHAPE;
    if (unshaping_table[ch].junk) {
      out[y++] = src[x];
      continue;
    }
    else {
      for (unsigned int i = 0; i < unshaping_table[ch].len; i++) {
        out[y++] = unshaping_table[ch].letters[i];
      }
    }
  }
  out[y] = 0x0;

  return out;
}

gunichar *shape_arabic(gunichar *src, unsigned len, unsigned *_len) {
  gunichar *out = g_malloc (sizeof (gunichar) * (len + 1));
  out[len] = 0x0;

  unsigned y;
  unsigned x = 0;

  for (y = 0; y < len; y++) {
    gboolean have_previous = TRUE, have_next = TRUE;

    /* If it's not in our range, skip it. */
    if ((src[y] < 0x621) || (src[y] > 0x64A)) {
      out[x++] = src[y];
      continue;
    }

    /* The character wasn't included in the unicode shaping table. */
    if (shaping_table[(src[y] - 0x621)].junk) {
      out[x++] = src[y];
      continue;
    }

    if (((src[y - 1] < 0x621) || (src[y - 1] > 0x64A)) ||
	(!(shaping_table[(src[y - 1] - 0x621)].initial) &&
	 !(shaping_table[(src[y - 1] - 0x621)].medial))) {
      have_previous = FALSE;
    }

    if (((src[y + 1] < 0x621) || (src[y + 1] > 0x64A)) ||
	(!(shaping_table[(src[y + 1] - 0x621)].medial) &&
	 !(shaping_table[(src[y + 1] - 0x621)].final)
	 && (src[y + 1] != 0x640))) {
      have_next = FALSE;
    }

    if (src[y] == 0x644) {
      if (have_next) {
	if ((src[y + 1] == 0x622) ||
	    (src[y + 1] == 0x623) ||
	    (src[y + 1] == 0x625) || (src[y + 1] == 0x627)) {
	  if (have_previous) {
	    if (src[y + 1] == 0x622) {
	      out[x++] = 0xFEF6;
	    }
	    else if (src[y + 1] == 0x623) {
	      out[x++] = 0xFEF8;
	    }
	    else if (src[y + 1] == 0x625) {
	      out[x++] = 0xFEFA;
	    }
	    else {
	      out[x++] = 0xFEFC;
	    }
	  }
	  else {
	    if (src[y + 1] == 0x622) {
	      out[x++] = 0xFEF5;
	    }
	    else if (src[y + 1] == 0x623) {
	      out[x++] = 0xFEF7;
	    }
	    else if (src[y + 1] == 0x625) {
	      out[x++] = 0xFEF9;
	    }
	    else {
	      out[x++] = 0xFEFB;
	    }
	  }
	  y++;
	  continue;
	}
      }
    }

    /** Medial **/
    if ((have_previous) && (have_next)
	&& (shaping_table[(src[y] - 0x621)].medial)) {
      out[x++] = shaping_table[(src[y] - 0x621)].medial;
      continue;
    }

    /** Final **/
    else if ((have_previous) && (shaping_table[(src[y] - 0x621)].final)) {
      out[x++] = shaping_table[(src[y] - 0x621)].final;
      continue;
    }

    /** Initial **/
    else if ((have_next) && (shaping_table[(src[y] - 0x621)].initial)) {
      out[x++] = shaping_table[(src[y] - 0x621)].initial;
      continue;
    }

    /** Isolated **/
    else {
      if (shaping_table[(src[y] - 0x621)].isolated) {
	out[x++] = shaping_table[(src[y] - 0x621)].isolated;
      }
      else {
	out[x++] = src[y];
      }
      continue;
    }
  }

  out[x] = 0x0;
  *_len = x;
  return out;
}
